import { Routes } from '@angular/router';
import { HomeComponent } from './home/home.component';
import { RegisterComponent } from './register/register.component';
import { LoginComponent } from './login/login.component';
import { ContactComponent } from './contact/contact.component';
import { AuthGuard } from '../guards/auth.guard';
import { ActivityListComponent } from './activity-list/activity-list.component';
import {CreateActivitiesComponent} from '../app/create-activities/create-activities.component';

const routes: Routes = [
  { path: '', component: HomeComponent [AuthGuard] },
  { path: 'register', component: RegisterComponent [AuthGuard] },
  { path: 'login', component: LoginComponent [AuthGuard] },
  { path: 'contact', component: ContactComponent [AuthGuard] },
  { path: 'listActivities', component: ActivityListComponent [AuthGuard] },
  { path: 'createActivities', component: CreateActivitiesComponent [AuthGuard] },
  { path: '**', redirectTo: '', pathMatch: 'full' }]

export { routes };
